import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Customers() {
  const [customerData, setCustomerData] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);
  const [filter, setFilter] = useState({});

  const fetchCustomers = async () => {
    try {
      const response = await axios.get('/api/customers', {
        params: { ...filter, page: currentPage }
      });
      setCustomerData(response.data.customers);
      setTotalPages(Math.ceil(response.data.totalCustomers / 30));
    } catch (error) {
      console.error('Error fetching customers:', error);
    }
  };

  useEffect(() => {
    fetchCustomers(); // Fetch customers when the component mounts or when the page changes
  }, [currentPage, filter]); // Dependency array includes currentPage and filter

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFilter({ ...filter, [name]: value });
  };

  const handleSearch = () => {
    setCurrentPage(1); // Reset page to 1 when performing a new search
    fetchCustomers();
  };

  const goToPage = (page) => {
    setCurrentPage(page);
  };

  return (
    <div>
      <h1>Customer Search</h1>
      <section>
        <div>
          <input
            type="search"
            placeholder="Customer ID"
            name="customer_id"
            onChange={handleInputChange}
            onKeyDown={(e) => {
              if (e.key === 'Enter') {
                handleSearch();
              }
            }}
          />
        </div>
        <div>
          <input
            type="search"
            placeholder="First Name"
            name="first_name"
            onChange={handleInputChange}
            onKeyDown={(e) => {
              if (e.key === 'Enter') {
                handleSearch();
              }
            }}
          />
        </div>
        <div>
          <input
            type="search"
            placeholder="Last Name"
            name="last_name"
            onChange={handleInputChange}
            onKeyDown={(e) => {
              if (e.key === 'Enter') {
                handleSearch();
              }
            }}
          />
        </div>
      </section>

      <div>
        <table className="styled-table">
          <thead>
            <tr>
              <th>ID</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th></th>
              <th></th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            {customerData.map((customer) => (
              <tr key={customer.customer_id}>
                <td>{customer.customer_id}</td>
                <td>{customer.first_name}</td>
                <td>{customer.last_name}</td>
                <td></td>
                <td></td>
                <td></td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div>
        <button
          disabled={currentPage === 1}
          onClick={() => goToPage(currentPage - 1)}
        >
          Previous
        </button>
        <span> Page {currentPage} of {totalPages} </span>
        <button
          disabled={currentPage === totalPages}
          onClick={() => goToPage(currentPage + 1)}
        >
          Next
        </button>
      </div>
    </div>
  );
}

export default Customers;
